import React from 'react';
import me from './assets/images/';
import './App.css';

function App() {
  return (
    <div className="wrapper">
		<div className="column1">
			<img src={me} alt="a picture of me"/>
		</div>
		<div className="column2">

		</div>
    </div>
  );
}

export default App;
